description:
Ben 10 Omniverse - S01 E01 - The More Things Change, Part 1 (Sneek Peek)

In the ongoing adventures of Ben 10, Ben, Gwen, and Kevin part ways as the teenage hero takes on a new alien partner, Rook and that the Ominitrix now gives him the ability to use 10 more aliens than before against some new enemies.

Aired tonight on Cartoon Network. Also included the September promo. 

